css:
atom-text-editor,
:host {
  background-color: #282c34;
  color: #ffffff;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #282a2e;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #373b41;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #373b41;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #282a2e;
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #373b41;
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #969896;
}
atom-text-editor .invisible,
:host .invisible {
  color: #ffffff;
}
atom-text-editor .cursor,
:host .cursor {
  color: #ffffff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #49515f;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #969896;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #969896;
}
.keyword {
  color: #b294bb;
}
.keyword.control {
  color: #77b1fb;
}
.keyword.operator {
  color: #e46969;
}
.keyword.other.special-method {
  color: #81a2be;
}
.keyword.other.unit {
  color: #de935f;
}
.storage {
  color: #77b1fb;
}
.constant {
  color: #b7d6fd;
}
.constant.character.escape {
  color: #8abeb7;
}
.constant.numeric {
  color: #e46969;
}
.constant.other.color {
  color: #e3e3e3;
}
.constant.other.symbol {
  color: #e3e3e3;
}
.variable {
  color: #e3e3e3;
}
.variable.interpolation {
  color: #bf4040;
}
.variable.parameter.function {
  color: #ffffff;
}
.invalid.illegal {
  background-color: #cc6666;
  color: #282c34;
}
.string {
  color: #80c278;
}
.string.embedded {
  color: #e3e3e3;
}
.string.constant {
  color: #e3e3e3;
}
.string.regexp {
  color: #8abeb7;
}
.string.regexp .source.ruby.embedded {
  color: #de935f;
}
.string.other.link {
  color: #cc6666;
}
.punctuation.definition.comment {
  color: #969896;
}
.punctuation.definition.string {
  color: #80c278;
}
.punctuation.definition.variable,
.punctuation.definition.array {
  color: #e46969;
}
.punctuation.definition.parameters {
  color: #e3e3e3;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #81a2be;
}
.punctuation.definition.bold {
  color: #f0c674;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #b294bb;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #FF5757;
}
.support.class {
  color: #e3e3e3;
}
.support.function {
  color: #e3e3e3;
}
.support.function.any-method {
  color: #81a2be;
}
.entity.name.function {
  color: #e3e3e3;
}
.entity.name.type {
  color: #e3e3e3;
  text-decoration: normal;
}
.entity.other.inherited-class {
  color: #80c278;
}
.entity.name.class,
.entity.name.type.class {
  color: #e3e3e3;
}
.entity.name.section {
  color: #81a2be;
}
.entity.name.tag {
  color: #cc6666;
}
.meta.class {
  color: #e3e3e3;
}
.meta.link {
  color: #de935f;
}
.meta.require {
  color: #77b1fb;
}
.meta.delimiter {
  color: #e3e3e3;
}
.meta.selector {
  color: #e46969;
}
.meta.selector.css {
  color: #6FD7FF;
}
.meta.separator {
  background-color: #373b41;
  color: #ffffff;
}
.css.class {
  color: #e46969;
}
.none {
  color: #ffffff;
}
.markup.bold {
  color: #de935f;
  font-weight: bold;
}
.markup.changed {
  color: #b294bb;
}
.markup.deleted {
  color: #cc6666;
}
.markup.italic {
  color: #b294bb;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #81a2be;
}
.markup.inserted {
  color: #80c278;
}
.markup.list {
  color: #cc6666;
}
.markup.quote {
  color: #de935f;
}
.markup.raw.inline {
  color: #80c278;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #80c278;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
.json.string {
  color: #e3e3e3;
}
.json.punctuation {
  color: #e46969;
}
.json.punctuation.string {
  color: #e46969;
}
